import React from "react";
import { Header, Carousel } from "../components/mollecules";
import { Button, Cards, Text } from "../components/atomes";
import GoogleMapReact from "google-map-react";
import { FaMapMarkerAlt } from "react-icons/fa";

const cardVinBlanc = require("../assets/cardVinBlanc.png");
const cardVinRouge = require("../assets/cardVinRouge.png");
const cardChampagne = require("../assets/cardChampagne.png");

function Home() {
  const defaultProps = {
    center: {
      lat: 43.6111946,
      lng: 3.8704633,
    },
    zoom: 13,
  };

  return (
    <div>
      <Header.laptopHeader />
      <Carousel.Carousel />
      
    </div>
  );
}

export default Home;
